(function(){var loadHandler=window['sl_{611D6902-219F-4674-87E1-6E81C4A04BDE}'];loadHandler&&loadHandler(4, '<div id="spr0_6e7cba"><div id="spr1_6e7cba" class="kern slide"><img id="img5_6e7cba" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_6e7cba"><div id="spr4_6e7cba"><img id="img0_6e7cba" src="data:image/png;base64," width="1279.5" height="720.75" alt="" style="left:0.188px;top:-0.281px;"/></div></div></div><div id="spr2_6e7cba" class="kern slide"><div id="spr5_6e7cba" style="left:41.49px;top:48.626px;"><div style="width:0px;"><span id="txt0_6e7cba" data-width="227.520844" style="left:9.6px;top:-0.597px;">Metodología</span></div></div><div id="spr6_6e7cba" style="left:41.25px;top:161.25px;"><img id="img1_6e7cba" src="data:image/png;base64," width="1206" height="166.5" alt=""/></div><div id="spr7_6e7cba" style="left:41.25px;top:161.25px;"><div style="width:0px;"><span id="txt1_6e7cba" class="relpos" data-width="547.078125" style="left:9.84px;top:1.666px;">Con respecto al método, se aplicó el de la </span> <span id="txt2_6e7cba" class="relpos" data-width="201.015625" style="left:9.833px;top:1.666px;">fenomenología</span> <span id="txt3_6e7cba" class="relpos" data-width="424.140625" style="left:9.826px;top:1.666px;">, para ello se adelantó una etapa</span></div><div style="width:0px;"><span id="txt4_6e7cba" data-width="1113.437500" style="left:9.84px;top:40.066px;">inicial, la cual buscaba hacer una descripción del fenómeno a analizar, en este caso, la</span></div><div style="width:0px;"><span id="txt5_6e7cba" data-width="1182.546875" style="left:9.84px;top:78.466px;">aplicación y efectividad del modelo pedagógico, en esta fase se desarrollaron las siguientes</span></div><div style="width:0px;"><span id="txt6_6e7cba" data-width="154.671875" style="left:9.84px;top:116.866px;">actividades:</span></div></div><div id="spr8_6e7cba" style="left:120px;top:321.75px;"><img id="img2_6e7cba" src="data:image/png;base64," width="1115.25" height="113.25" alt=""/></div><div id="spr9_6e7cba" style="left:120px;top:321.75px;"><div style="width:0px;"><span id="txt7_6e7cba" data-width="1062.515625" style="left:19.277px;top:12.919px;">1. Se realizó la revisión, análisis e interpretación del PEI de la institución mediante</span></div><div style="width:0px;"><span id="txt8_6e7cba" data-width="1020.281250" style="left:19.277px;top:51.319px;">una matriz de categorías, en especial lo relacionado con el modelo pedagógico</span></div></div><div id="spr10_6e7cba" style="left:120px;top:417px;"><img id="img3_6e7cba" src="data:image/png;base64," width="1115.25" height="189" alt=""/></div><div id="spr11_6e7cba" style="left:120px;top:417px;"><div style="width:0px;"><span id="txt9_6e7cba" data-width="1048.343750" style="left:19.277px;top:11.871px;">2. Se solicitó a la IE la información relacionada con los resultados que obtuvieron</span></div><div style="width:0px;"><span id="txt10_6e7cba" data-width="1038.281250" style="left:19.277px;top:50.271px;">los estudiantes frente a los procesos de evaluación interna (registro de notas de</span></div><div style="width:0px;"><span id="txt11_6e7cba" data-width="1069.453125" style="left:19.277px;top:88.671px;">todas las asignaturas) del año 2021 y se realizó la búsqueda de los resultados de la</span></div><div style="width:0px;"><span id="txt12_6e7cba" data-width="536.281250" style="left:19.277px;top:127.071px;">evaluación externa (pruebas ICFES 2021).</span></div></div><div id="spr12_6e7cba" style="left:120px;top:594.75px;"><img id="img4_6e7cba" src="data:image/png;base64," width="1115.25" height="113.25" alt=""/></div><div id="spr13_6e7cba" style="left:120px;top:594.75px;"><div style="width:0px;"><span id="txt13_6e7cba" data-width="1059.750000" style="left:19.277px;top:12.832px;">3. Con la información recolectada se trazó el plan de trabajo para la identificación</span></div><div style="width:0px;"><span id="txt14_6e7cba" data-width="1023.515625" style="left:19.277px;top:51.232px;">del modelo pedagógico dominante desde la propuesta de Román y Diez (2004)</span></div></div></div></div>', '{"s":[]}');})();